import React from "react";
import { VStack, Heading, Input, Icon ,Ionicons} from "native-base";
const search = () => {
  return (
    <VStack w="100%" space={5} alignSelf="center">
      <Heading fontSize="lg">Cupertino</Heading>
      <Input
        placeholder="Search"
        variant="filled"
        width="100%"
        borderRadius="10"
        py="1"
        px="2"
        borderWidth="0"
        InputLeftElement={
          <Icon
            ml="2"
            size="4"
            color="gray.400"
            as={<Ionicons name="ios-search" />}
          />
        }
      />
    </VStack>
  );
};

export default search;
